function teste () {
  return (<div>io</div>)
}

const DateContainer = () => {
  return (
    <div id="date-container">
      <select>{teste}</select>
      <select></select>
      <select></select>
    </div>
  )
}


function createMonthsOptions() {
  const month = ["January", "February", "March", "April", "May", "June", 
  "July", "August", "September", "October", "November", "December"];
  const option = new Array(month.length);
  for(let i = 0; i < month.length; i++) {
    option[i] = <option value={i + 1}>{month[i]}</option>
  }
  return <option>adsa</option>;
}

export default DateContainer;
